import axios from "axios";

export const SearchRestaurantAPI = async (
  bigLocation,
  smallLocation,
  setRestuarantData
) => {
  const url = `http://3.35.140.28:9000/shop/address?pageIndex=1&pageSize=10&first=서울특별시&second=%EC%84%B1%EB%B6%81%EA%B5%AC`;

  try {
    const data = await axios({
      method: "get",
      url: url,
    });
    console.log(data.data.result);
    // setRestuarantData(data.data.result);
  } catch (err) {
    alert(err);
  }
};

export default SearchRestaurantAPI;
